id: lessonpart1
title: Publishing your game
content: |
  One of the best parts about creating a game is sharing it with others. VS Code for Education provides an easy way to share the game that you've created with anyone on the internet. It does take a couple of steps as detailed below.

  ### Creating a Project

  Your game can't be shared directly from a course. To share it, we'll have to transfer it to a VS Code for Education project. To create a project, first go to the [projects section](https://vscodeedu.com/my-work/projects) on VS Code for Education. The click "Create New Project" and select "HTML5 web site" in the project type popup. When the project loads you will have a basic website with a index.html, script.js, and styles.css files.

  ![1.00](data:image/png;base64,)

  From your course (you can have this new project in a separate tab) copy the contents of your index.html, script.js, and styles.css into the project files, replacing their current contents. At this point, you should have the full game running in the preview window.

  ![1.00](data:image/png;base64,)

  In the button left there is a section called "Sharing" that was not present in the course. This section gives you two options. First the "Share Code" button will create a link to the project code, if you've made some cool additions to your SHMUP and you want to show another VS Code for Education user your code, this is the way to share that. When opened this link will show them a read-only version of the project code, and they can then make of copy of that to make their own improvements. The second button is "Publish Site" this is the option that you want if you just want to share your game with someone. Pressing this button will create a live link to just the HTML for your game, with a permanent address you can use to share your creation online. Send this one to friends and family to show of what you made, or to get user feedback for your game!

  ![1.00](data:image/png;base64,)

